import $api from "../http";

export default class UserService {
  static fetchUsers() {
    try {
      const response = $api.get("/user");
      return response;
    } catch (err) {
      console.error(err);
    }
  }
  static editUser({
    id,
    name,
    balance,
    discord_id,
    birthday,
    dt,
    tmrpg,
    selectedServer,
  }) {
    try {
      const response = $api.put("/user", {
        id: id,
        name: name,
        balance: balance,
        discord_id: discord_id,
        birthday: birthday,
        dt: dt,
        tmrpg: tmrpg,
        selectedServer: selectedServer,
      });
      return response;
    } catch (err) {
      console.error(err);
    }
  }
}
